import React from "react";
import { Link } from "react-router-dom";
class Profile extends React.Component{
    constructor(props){
        super(props);
        this.state = {
            reviews: 10,
            reviews_per_page: 5,
            current_page: 1,
        }
        this.increase_page_number = this.increase_page_number.bind(this);
        this.decrease_page_number = this.decrease_page_number.bind(this);
    }
    ceil(a,b){
        if(a%b==0) return a/b;
        else return a/b + 1;
    }
    decrease_page_number(){
        if(this.state.current_page>0){
            this.setState(prevState => ({
                current_page: prevState.current_page-1
            }));
        }
    }
    increase_page_number(){
        if(this.state.current_page<ceil(this.state.reviews.this.state.reviews_per_page)){
            this.setState(prevState => ({
                current_page: prevState.current_page+1
            }));
        }
    }
    render(){
        return(
            <div className="container">
            <div className="main-body">
                <div className="row gutters-sm">
                    <div className="col-md-4 mb-3">
                        <div className="card mt-2">
                            <div className="card-body">
                            <div className="d-flex flex-column align-items-center text-center">
                                <img src="https://upload.wikimedia.org/wikipedia/commons/2/2f/Hubble_ultra_deep_field.jpg" alt="User" className="rounded-circle" width="150"/>
                                <div className="mt-4">
                                    <h4>Username</h4>
                                    <p className="text-secondary mb-1">Intro</p>
                                </div>
                            </div>
                            </div>
                        </div>
                    </div>
                    <div className="col-md-8 mt-2">
                        <div className="card mb-3">
                            <div className="card-body">
                            <div className="row justify-content-end align-items-center">
                                <div className="col-sm-3">
                                    <h6 className="mb-0">Full Name</h6>
                                </div>
                                <div className="col"> Real Name </div>
                                <div className="col">
                                <a className="btn btn-primary" href="/edit-profile">Edit Details</a>
                                </div>
                            </div>
                            <hr />
                            <div className="row align-items-center">
                                <div className="col-sm-3">
                                <h6 className="mb-0">Email</h6>
                                </div>
                                <div className="col"> example@example.com </div>
                            </div>
                            <hr />
                            <div className="row align-items-center">
                                <div className="col-sm-3">
                                <h6 className="mb-0">Sex</h6>
                                </div>
                                <div className="col">  </div>
                            </div>
                            <hr />
                            <div className="row align-items-center">
                                <div className="col-sm-3">
                                <h6 className="mb-0">Date Of Birth</h6>
                                </div>
                                <div className="col">  </div>
                            </div>
                            <hr />
                            <div className="row align-items-center">
                                <div className="col-sm-3">
                                <h6 className="mb-0">Contact</h6>
                                </div>
                                <div className="col"> +91 9999999999 </div>
                            </div>
                            </div>
                        </div>
                    </div>
                </div>
                <hr />
                <h2 Style="text-align: center"> User Reviews </h2>
                <div className="d-flex justify-content-center row gutters-sm">
                    <div className="col-4"> <button className = "btn btn-primary" onClick={this.decrease_page_number}>Prev</button> </div>
                    <div className="col-4"> <Link to="." className = "btn btn-primary">{this.state.current_page}</Link> </div>
                    <div className="col-4"> <button onClick={this.increase_page_number} className = "btn btn-primary">Next</button> </div>
                </div>
            </div>
            </div>
        )
    }
}
export default Profile;
